%% PAr - Prot 1.0
clear all
close all
import BARRE
import NOEUD

%% PARAMETRES DE LA STRUCTURE

N = 3;

NOEUD_LIST = [NOEUD(0,0) NOEUD(0.5,0) NOEUD(1,0) ];


BARRE_LIST = [ BARRE( 7.86e3 , .01 , 210e9 , 8.3e-6 , NOEUD_LIST(1), NOEUD_LIST(2) ) BARRE( 7.86e3 , .01 , 210e9 , 8.3e-6 , NOEUD_LIST(2), NOEUD_LIST(3) )  ];

NOEUD_LIST(1).addBarre(BARRE_LIST(1),1); %1 = encastrement
NOEUD_LIST(2).addBarre(BARRE_LIST(1),1);
NOEUD_LIST(2).addBarre(BARRE_LIST(2),1);
NOEUD_LIST(3).addBarre(BARRE_LIST(2),1);



%% PARAMETRES DE OPTIMISATION

f_init = 1;
f_step = 10;
f_max  = 4000;

%% REPONSE LIBRE - FREQUENCES PROPRES
p = [];
freq = [];
dif_ant = 1;
p_ant = 100 ;
FREQS_PROP = [];
options = optimset('Display','off');

for f = f_init:f_step:f_max
    
   freq = [freq f]; 
   w = f*2*pi;
   
   DET_M = @(w) abs(det(M(w,BARRE_LIST,NOEUD_LIST)));
   
   p_neuf = DET_M(w);
   p = [p p_neuf];
   
   dif_neuf = p_neuf - p_ant;
   
   if and((dif_ant < 0),(dif_neuf > 0))
      racine = fsolve(DET_M,w-(f_step*pi),options);
      FREQS_PROP = [FREQS_PROP   racine/(2*pi)];
   end
   
   dif_ant = dif_neuf;
   p_ant   = p_neuf;
   
end

plot(freq,p)

%% REPONSE LIBRE - MODES PROPRES

MODES_PROP = [];


for k=1:size(FREQS_PROP,2)
    
    w = FREQS_PROP(k)*(2*pi);
    
    [vect_p,D] = eig(M(w,BARRE_LIST,NOEUD_LIST));
    val_p = abs(diag(D));
    [val,indx] = min(val_p);
    
    MODES_PROP = [MODES_PROP vect_p(:,indx)];
end

%% PLOT MODES


