%% DEFINITIONS

function X = Dispersion(w,BARRE_LIST)

N_BARRE = size(BARRE_LIST,2);
X = zeros(6*N_BARRE); 

for k = 1:N_BARRE
    
     X((6*(k-1) + 1):(6*k - 3),(6*(k-1) + 1):(6*k - 3)) = BARRE_LIST(k).Delta(w);
     X((6*(k-1) + 4):(6*k    ),(6*(k-1) + 4):(6*k    )) = BARRE_LIST(k).Delta(w);
     
end 

end

